import Post from './Post';
import Loki from 'images/Loki.jpeg';

console.log(Loki);

const Feed = ({ pets }) => {
    return (
        <>
            {pets.map(pet => (
                <Post key={pet.id} pet={pet} />
            ))}
        </>
    )
}

export default Feed
